import React from 'react'
import styled from 'styled-components'


const Styles = styled.div`

    .container {
        width: 100%;
        height: 100%;
        background-color: #A9BCD0;
    }

    .content {
        position: relative;
        top: 0;
        left: 0;
        bottom:0;
        right:0;
      }
    
    .title {
        color: white;
        font-family: Verdana, Arial, Helvetica, sans-serif;
        text-align: center;
        font-Size: 35px;
        letter-spacing: 3px;
    }

    .logo {
        height: 25px;
        width: 25px;
    }
`;

const ExperiencesPage = () => {
    return (
        <Styles>
            <div className="container">
                <div className="content">
                    <p className="title">EXPERIENCES</p>
                    <ul id="experiencesList">
                        <li><a href="https://www.intel.com/content/www/us/en/homepage.html"><img src="../../assets/intel.jpg" className="logo" title="Intel Logo" alt="iLogo"/></a>
                            Software Developer Intern
                            <ul id="intelList">
                                <li>Hillsboro, Oregon</li>
                                <li>May 2019 - August 2019"</li>
                                <li>Developed new capabilities for a product development group security portal, to ensure compliance with security development lifecycle requirements</li>
                                <li>Created infrastructure for AI deployment to enhance quality of threat intelligence reporting and drove design and implementation of a ML model</li>
                                <li>Improved web navigation interface for users to view cyber security data in an intuitive manner</li>
                                <li>Presently modernizing business groupâ€™s product life cycle management tools</li>
                            </ul>
                        </li>
                        <li></li>
                        <li><a href="https://www.vectorsolutions.com/"><img src="../../assets/vectorsolutions.jpg" className="logo" title="Vector Solutions Logo" alt="vslogo"/></a>
                            Data Management Intern
                            <ul id="vectorList">
                                <li>Tampa, Florida</li>
                                <li>April 2018 - May 2018</li>
                                <li>Collaborated in data compilation for company merging in Excel and SQL Server Management Studio</li>
                                <li>Utilized critical thinking in troubleshooting errors in millions of record updates via. Salesforce web interface</li>
                            </ul>
                        </li>
                    </ul>
                </div>
            </div>
        </Styles>
    )
}

export default ExperiencesPage
